// src/components/Resume.js
import React from 'react';
import './Resume.css';

const Resume = () => {
    return (
        <div className="container-content">
            <h1>RESUME</h1>
            <div>
                <h2>Professional Experience</h2>
                <h4>IT Support-Digitization   ---  Digital Imaging and Scanning International</h4>
                <h4>Period  --- October 2022- Present</h4>
                <h4>Responsibilities and Achievements:</h4>
                <ul className="resume-list">
                    <li>Evaluate, install, and configure computer hardware components</li>
                    <li>Troubleshoot and resolve hardware issues</li>
                    <li>Network infrastructure setup and maintenance</li>
                    <li>Install and configure software applications and licenses.</li>
                    <li>Databases Setup, configuration, and troubleshooting.</li>
                </ul>
            </div>
            <div>
                <h3>Project 2</h3>
                <p className="resume-paragraph">Description of Project 2.</p>
            </div>
            {/* Add more projects as needed */}
        </div>
    );
};

export default Resume;
